// Конфигурация API 2ГИС
export const API_CONFIG = {
  KEY: '8f104049-075f-4c47-817b-b8b450854d86',
  BASE_URL: 'https://api.2gis.ru/2.0/loader.js',
  PACKAGE: 'full'
};

export const get2GISScriptUrl = () => {
  return `${API_CONFIG.BASE_URL}?pkg=${API_CONFIG.PACKAGE}&key=${API_CONFIG.KEY}`;
};
